import {makePostHelper} from "../javascript/Server"
const expectPass = (func,...args) =>  {
    try {
        func(...args)
    } catch (exception) {
        return exception
    }
}

const expectFail = (func,...args) =>  {
    try {
        func(...args)
        console.log("ExpectFail failed")

    } catch (exception) {
        console.log("ExpectFail succeed")
    }
}

const testMakeFalsyPost = () => {
    const flawPostObj = {
        author : "Wonjae Lee"
    }

    expectFail(makePostHelper, "testPosts", flawPostObj)
}

export const runTests = () => {
    testMakeFalsyPost();
}
